EIXO_Y 	   	DW 0
EIXO_X 	 	DW 0
COR 	 	DB 0

QTD_LINHA	DW 200
QTD_COLUNA	DW 224

PIVO_X		DW	0
PIVO_Y		DW	0

CONT		DW	0
CONT2		DW 	0

.CODE

MAIN PROC

	MOV AX, @DATA
	MOV DS, AX
	
	MOV AX,13H
	INT 10H	
	
	ADD PIVO_X,0 
	ADD PIVO_Y,0
	
	LEA SI,MAPA_01
	CALL PRINT
	
	ADD PIVO_X,68
	ADD PIVO_Y,50
		
	ANDA_X:
	MOV QTD_LINHA,15
	MOV QTD_COLUNA,16	
	LEA SI,FANT_R		
	CALL PRINT	
	INC CONT
	ADD PIVO_Y,1
	CMP CONT,50	
	JNE ANDA_X
	
	
	
	CALL PULA_LINHA
	CALL PULA_LINHA
	JMP FINAL
	
MAIN ENDP


PRINT PROC
	MOV BX,PIVO_X		
	ADD EIXO_X,BX		;O eixo X tem a coordena do primeiro pixel em X da matriz, quando somado com o pivo, o inicio é deslocado
	ADD QTD_COLUNA,BX	;A QTD_COLUNA tem a coordenada do ultimo pixel da coluna, e tbm é somado ao pivo 
	
	MOV BX,PIVO_Y		
	ADD EIXO_Y,BX		;Mesma coisa com Y e as linhas
	ADD QTD_LINHA,BX 	;
	
INICIO:
						;Sem alterações daqui
	MOV BX,QTD_COLUNA  	;colunas
	CMP	EIXO_X, BX    	
		JNE COR_PIXEL
	
	MOV BX,QTD_LINHA   	;linhas
	CMP	EIXO_Y, BX	  
		JE	FIM_PRINT	
	INC EIXO_Y
	MOV BX,PIVO_X
	MOV	EIXO_X,BX	
		JMP INICIO		;Até aqui
		
	COR_PIXEL:
	MOV AL,[SI]	        ;;;;;;;;;;;AL recebe a cor do endereço de SI 
	MOV AH,0			;;;;;;;;;;;O byte high de AX é zerado (tinha os lixo desgraçado) 
	MOV COR,AL 			

	MOV	AH, 0CH			;A partir daqui printa a cor na coordena dos EIXO_
	MOV	CX,	EIXO_X
	MOV DX, EIXO_Y
	MOV AL,	COR
	INT	10H		
	INC SI
	INC EIXO_X	
	JMP	INICIO 	
	
	FIM_PRINT:
	MOV EIXO_X,0
	MOV EIXO_Y,0	
	RET	
	
PRINT ENDP



PULA_LINHA PROC 
    
	MOV AH,2h
	MOV DX,0Ah
	INT 21h
	
	MOV AH,2h
	MOV DX,0Dh
	INT 21h
	RET
	PULA_LINHA ENDP




FINAL:

	
MOV AH,4CH
INT 21H
END